column3:
        סוף דבר אפוא ובהינתן כל האמור, אנו גוזרים על הנאשם את העונשים
הבאים;
בגין מעשה החטיפה והרצח של סילביה המנוחה - מאסר עולם.

}
עו"ד טל: הנאשם מסכים
לרצות את עונש המאסר בעבודות שירות.

  מאסר בן 9 חודשים, אך הנאשם לא יישא עונש זה אלא
אם בתוך 3 שנים מיום שחרורו מהמאסר יעבור עבירת מין מסוג פשע;
מאסר בן 3 חודשים, אך הנאשם לא ישא עונש זה
אלא אם בתוך 3 שנים מיום שחרורו מהמאסר יעבור עבירת מין מסוג עוון או עבירת
התחזות;
ג.

     6 חודשי מאסר ויום מאסר בפועל בניכוי ימי מעצרו, ככל שהיה עצור בתיק,
על-פי חישוב שב"ס שיכריע;
ב.

      10 חודשי מאסר, שלא ירוצו אלא אם יעבור הנאשם כל עבירת מין לרבות מעשה
מגונה והטרדה מינית, בתוך שלוש שנים מיום שחרורו;
ג.

] אין בידי לקבל את טענת המערער לפיה שיקולי שיקום בלבד
הם אלו שצריכים לעמוד לנגד עיני בית המשפט בעת גזירת עונשו, באופן המבכר השתת עונש
לריצוי בדרך של עבודות שירות על פני עונש מאסר בפועל.
